import React from "react";
import "../styles/Signin.css";
import Form from "react-bootstrap/Form";

function Signin() {
    return (
        <Form>
            <Form.Group>
                <Form.Label>Email</Form.Label>
                <Form.Control
                    type="email"
                    placeholder="email"
                />
            </Form.Group>
            <Form.Group>
                <Form.Label>Password</Form.Label>
                <Form.Control
                    type="password"
                    placeholder="password"
                />
            </Form.Group>
        </Form>
    );
}

export default Signin;
